import psvtrophyisgoodAidSelect_support

def vp_start_gui(v):
    global npCommId
    npCommId = v
    global val, w, root
    root = Tk()
    root.resizable(0, 0)
    root.protocol("WM_DELETE_WINDOW", lambda: os._exit(0))
    psvtrophyisgoodAidSelect_support.set_Tk_var()
    top = Change_Account (root)
    psvtrophyisgoodAidSelect_support.init(root, top)
    root.mainloop()

w = None
def create_Change_Account(root, *args, **kwargs):
    '''Starting point when module is imported by another program.'''
    global w, w_win, rt
    rt = root
    w = Toplevel (root)
    psvtrophyisgoodAidSelect_support.set_Tk_var()
    top = Change_Account (w)
    psvtrophyisgoodAidSelect_support.init(w, top, *args, **kwargs)
    return (w, top)

def destroy_Change_Account():
    global w
    w.destroy()
    w = None


